const redirect_uri =
    "https://realm.mongodb.com/api/client/v2.0/auth/callback";
const client_id =
    "291216037477-tlo72q1hnsl5kk6qph3spkc191mhnfn2.apps.googleusercontent.com";
const loginUri = `https://accounts.google.com/o/oauth2/v4/token?
  scope=https%3A//www.googleapis.com/auth/drive.metadata.readonly&
  include_granted_scopes=true&
  response_type=token&
  redirect_uri=${redirect_uri}&
  client_id=${client_id}`;
export default loginUri;
